@import "mixin";

/* Header */
header {
  position: fixed;
  left: 0;
  top: 0;
  width: 100%;
  height: 60px;
  background-color: #fff;
  z-index: 100;
  .inner {
    height: 60px;
  }
  .flex-wrap {
    display: flex;
    justify-content: space-between;
    align-items: center;
    height: 100%;
  }
  .menu-wrap {
    display: none;
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: calc(var(--vh, 1vh) * 100);
    padding-top: 15rem;
    z-index: 200;
    background-color: #fff;
    &.active {
      display: flex;
      justify-content: space-between;
      flex-direction: column;
    }
  }
  .close-btn {
    position: absolute;
    width: 50px;
    height: 50px;
    left: 50%;
    top: 5%;
    transform: translateX(-50%);
    border: 1px solid #000;
    border-radius: 50%;
    a {
      display: block;
      height: 100%;
    }
    i {
      position: absolute;
      left: 26%;
      top: 50%;
      transform: translateY(-50%);
      width: 50%;
      height: 2px;
      background-color: #333;
      &:nth-of-type(1) {
        transform: rotate(45deg);
      }
      &:nth-of-type(2) {
        transform: rotate(-45deg);
      }
    }
  }
  nav {
    height: calc(var(--vh, 1vh) * 100 - 28rem);
    padding: 0 20px;
    .scroll-wrap {
      height: 100%;
      overflow-y: scroll;
      & > ul > li {
        padding-bottom: 1rem;
        margin-bottom: 2rem;
        border-bottom: 1px solid #e5e5e5;
        &:last-child {
          margin-bottom: 0;
          border-bottom: none;
        }
        & > a {
          display: inline-block;
          font-size: 2rem;
          font-weight: 500;
          margin-bottom: 2rem;
        }
      }
    }

    .sub-menu {
      // display: none;
      li {
        margin-bottom: 1.5rem;
        & > a {
          font-size: 1.4rem;
          font-weight: 300;
        }
      }
    }
  }
  .search {
    position: relative;
    padding-top: 4.5rem;
    height: 13rem;
    background-color: #3e3e40;
    .wrap {
      position: relative;
      width: 90%;
      height: 4rem;
      margin: 0 auto;
    }
    input {
      display: block;
      width: 100%;
      height: 100%;
      padding: 0 3.5rem 0 1rem;
      border: none;
      outline: none;
      color: #ccc;
      font-weight: 300;
      font-size: 2rem;
      border-bottom: 1px solid #ccc;
      background-color: transparent;
      font-size: 1.5rem;
      &::placeholder {
        font-size: 1.5rem;
      }
    }
    .search-btn {
      position: absolute;
      right: 0;
      top: 15%;
      width: 3rem;
      height: 2.5rem;
      background-size: contain;
      background-color: transparent;
      background-image: url("../images/icon/header_search.png");
      background-repeat: no-repeat;
    }
  }
}
.header-left {
  display: flex;
  align-items: center;
  .header-logo {
    width: 140px;
    margin-right: 5px;
    h1 {
      img {
        width: 100%;
      }
    }
  }
  .language {
    position: relative;
    .language-btn {
      width: 60px;
      height: 40px;
      padding-top: 5px;
      text-align: center;
      &:before {
        content: "\f0d7";
        position: absolute;
        top: 50%;
        right: 0;
        transform: translateY(-50%);
        font-size: 16px;
        color: #111;
        font-family: fontawesome;
      }
    }
    &.active > .language-box {
      display: block;
    }
  }
  .language-box {
    display: none;
    position: absolute;
    left: 0;
    top: 40px;
    width: 120px;
    padding: 20px 0;
    box-shadow: 3px 3px 10px 1px gray;
    background-color: #fff;
    text-align: center;
    z-index: 10;
    @include font_poppins;
    strong {
      position: relative;
      display: inline-block;
      margin-bottom: 10px;
      font-size: 14px;
      font-weight: 700;
      color: rgb(51, 51, 51);
      &::before {
        content: "";
        position: absolute;
        left: 0;
        bottom: -7.5px;
        width: 100%;
        height: 1px;
        background-color: rgb(51, 51, 51);
        opacity: 0.2;
      }
    }
    ul {
      li {
        text-align: center;

        &:hover span {
          color: rgb(224, 6, 42);
        }
        a {
          font-size: 1.3rem;
          color: #000;
        }
        img {
          width: 30px;
          margin-right: 10px;
          transform: translateY(5px);
        }
        &:nth-child(n + 2) {
          margin-top: 5px;
        }
      }
    }
  }
}
.header-right {
  display: flex;
  align-items: center;
  .search-icon {
    width: 25px;
    margin-top: 9px;
    img {
      width: 100%;
    }
  }
  .menu-trigger {
    position: relative;
    width: 30px;
    height: 23px;
    margin-left: 15px;
    a {
      display: block;
      height: 100%;
    }
    i {
      position: absolute;
      width: 100%;
      height: 3px;
      background-color: #000;
      &:nth-of-type(1) {
        top: 0;
        left: 0;
      }
      &:nth-of-type(2) {
        top: 50%;
        left: 0;
      }
      &:nth-of-type(3) {
        width: 60%;
        right: 0;
        top: 100%;
      }
    }
  }
}

/* video-section */

#video-section {
  position: relative;
  padding-top: 60px;
  .inner {
    position: relative;
  }
  img {
    display: block;
    width: 100%;
  }
  .video-wrap {
    display: none;
  }
  .text-wrap {
    position: absolute;
    left: 10%;
    top: 7%;
    strong {
      display: block;
      margin-bottom: 0.7rem;
      font-size: 4rem;
      font-weight: 300;
      text-shadow: 0 0 8px rgb(34, 34, 34);
      line-height: 1.2;
      @include font_poppins;
      color: #fff;
    }
    span {
      display: block;
      font-size: 2.4rem;
      font-weight: 100;
      text-shadow: 0 0 5px rgb(0, 0, 0);
      line-height: 1.4;
      @include font_poppins;
      color: #fff;
    }
  }
  &:before {
    content: "";
    position: absolute;
    bottom: 3%;
    left: 50%;
    width: 10vw;
    height: 10vw;
    transform: translateY(-15px) translateX(-50%);
    background-image: url("../images/icon/scroll_down_main.png");
    background-size: contain;
    background-position: center;
    background-repeat: no-repeat;
    animation: scroll_down 1.7s infinite ease-out;
    opacity: 1;
    z-index: 10;
  }

  @keyframes scroll_down {
    50% {
      transform: translateY(0) translateX(-50%);
    }
  }
}

/* Microbiome Section */

#microbiome-section {
  background-image: url(../images/microbiome-section/section02_bg.jpg);
  background-size: 250vw;
  background-position: right bottom;
  background-repeat: no-repeat;
  .inner {
    position: relative;
    padding: 5rem 0 6.4rem;
  }
  .text-wrap {
    & > div:nth-of-type(1) {
      margin-bottom: 3rem;
    }
    & > div:nth-of-type(2) {
      margin-bottom: 2rem;
    }
  }
  i {
    position: relative;
    display: inline-block;
    padding-left: 4.5rem;
    font-size: 1.5rem;
    font-weight: 100;
    color: rgb(17, 17, 17);
    &::before {
      content: "";
      position: absolute;
      left: 0;
      top: 50%;
      transform: translateY(-50%);
      width: 3.5rem;
      height: 1px;
      background-color: #000;
    }
  }
  strong {
    display: block;
    font-size: 4rem;
    font-weight: 300;
    span {
      display: block;
      font-weight: 500;
      line-height: 1.27;
    }
  }
  ul {
    display: flex;
    align-items: center;
    justify-content: space-between;
    max-width: 260px;
    li {
      width: 50%;
      a {
        display: block;
        margin-bottom: 2rem;
        font-size: 1.4rem;
        font-weight: 500;
        color: rgb(17, 17, 17);
      }
      span {
        font-size: 1.4rem;
        font-weight: 100;
        color: rgb(17, 17, 17);
      }
    }
  }
  .more-btn {
    position: relative;
    display: inline-block;
    margin-top: 3rem;
    a {
      display: inline-block;
      padding: 2rem 0 1.3rem;
      width: 120%;
      font-size: 1.7rem;
      font-weight: 300;
      color: rgb(17, 17, 17);
      @include font_poppins;
    }
    .arrow {
      position: absolute;
      width: 120%;
      height: 1px;
      bottom: 0;
      left: 0;
      background-color: rgb(17, 17, 17);
      &:before {
        content: "";
        position: absolute;
        right: -3px;
        top: -5px;
        transform: rotate(45deg);
        width: 15px;
        height: 1px;
        background-color: rgb(17, 17, 17);
      }
      &:after {
        content: "";
        position: absolute;
        right: -3px;
        bottom: -5px;
        transform: rotate(-45deg);
        width: 15px;
        height: 1px;
        background-color: rgb(17, 17, 17);
      }
    }
  }
  .img-wrap {
    width: 100%;
    max-width: 700px;
    margin: 0 auto;
    img {
      width: 100%;
    }
  }
}

/* Health Section */

#health-section {
