      pointer-events: none;
    }
  }
}

/* Natural Section */

#natural-section {
  .inner {
    width: 100%;
  }
  article.top {
    ul {
      display: flex;
      flex-flow: row wrap;
      li {
        position: relative;
        width: 50%;
        @include background;
        background-repeat: no-repeat;
        &:nth-child(1) {
          background-image: url("../images/natural-section/mc04_01.jpg");
        }
        &:nth-child(2) {
          background-image: url("../images/natural-section/mc04_02.jpg");
        }
        &:nth-child(3) {
          background-image: url("../images/natural-section/mc04_03.jpg");
        }
        &:nth-child(4) {
          background-image: url("../images/natural-section/mc04_04.jpg");
        }
        &:after {
          opacity: 0;
          content: "";
          position: absolute;
          left: 0;
          top: 0;
          width: 100%;
          height: 100%;
          transition: 0.3s;
          background: linear-gradient(to bottom, rgba(0, 177, 235, 0.9) 0%, rgba(35, 51, 133, 0.9) 100%);
          pointer-events: none;
        }
        &:before {
          opacity: 0;
          content: "\f002";
          position: absolute;
          left: 50%;
          top: 50%;
          transform: translate(-50%, -50%);
          font-size: 6rem;
          color: #fff;
          font-family: fontawesome;
          pointer-events: none;
          z-index: 6;
        }
        &:hover:after {
          opacity: 1;
        }
        &:hover:before {
          opacity: 1;
        }
        &:hover .text-box strong {
          color: #fff;
        }
        &:hover .text-box span {
          color: #fff;
        }
        a {
          display: block;
          width: 100%;
          padding-bottom: 52vw;
        }
        .text-box {
          position: absolute;
          left: 5%;
          top: 6%;
          z-index: 5;
          strong {
            display: block;
            margin-bottom: 1rem;
            font-size: 2.4rem;
            font-weight: 500;
            transition: color 0.2s;
            color: #111;
          }
          span {
            font-size: 1.4rem;
            font-weight: 300;
            transition: color 0.2s;
            color: #111;
          }
        }
      }
    }
  }
  article.bottom {
    padding: 50px 15px;
    ul {
      li {
        display: flex;
        justify-content: space-between;
        align-items: end;
        margin-bottom: 5rem;
        &:last-child {
          margin-bottom: 0;
        }
        i {
          position: relative;
          display: inline-block;
          padding-left: 4.5rem;
          margin-bottom: 3rem;
          font-size: 1.5rem;
          font-weight: 100;
          color: rgb(17, 17, 17);
          &::before {
            content: "";
            position: absolute;
            left: 0;
            top: 50%;
            transform: translateY(-50%);
            width: 3.5rem;
            height: 1px;
            background-color: #000;
          }
        }
        strong {
          display: block;
          font-size: 1.7rem;
          font-weight: 700;
          color: #111;
        }
        .more-btn {
          position: relative;
          display: inline-block;
          padding: 1rem 5rem 1rem 1.5rem;
          border: 1px solid #111;
          font-weight: 400;
          &:before {
            content: "\f105";
            position: absolute;
            right: 8%;
            top: 50%;
            transform: translateY(-50%);
            font-family: fontawesome;
            font-size: 1.5rem;
          }
        }
      }
    }
  }
}

/* Footer */
#footer {
  background-color: #3f3f41;
  .inner {
    padding: 20px 0 25px;
  }
  .flex-wrap {
    display: flex;
    justify-content: space-between;
    align-items: end;
  }
  .footer-logo {
    width: 12rem;
    margin-bottom: 2rem;
    img {
      width: 100%;
    }
  }
  i {
    display: inline-block;
    margin-bottom: 3rem;
    font-size: 1.2rem;
    font-weight: 400;
    color: rgb(153, 153, 153);
  }
  .family-site {
    position: relative;
    width: 16rem;
    height: 3rem;
    select {
      width: 100%;
      height: 100%;
      line-height: 2.5rem;
      padding: 0 1.5rem;
      border: 1px solid rgb(153, 153, 153);
      background-color: transparent;
      color: rgb(153, 153, 153);
      outline: none;
      -webkit-appearance: none; /* 크롬 화살표 없애기 */
      -moz-appearance: none; /* 파이어폭스 화살표 없애기 */
      appearance: none; /* 화살표 없애기 */
      text-transform: uppercase;
    }
    &:before {
      content: "\f107";
      position: absolute;
      right: 5%;
      top: 50%;
      transform: translateY(-50%);
      font-size: 1.5rem;
      font-family: fontawesome;
      color: rgb(153, 153, 153);
    }
    span {
      font-size: 1.2rem;
      text-transform: uppercase;
      color: rgb(153, 153, 153);
    }
  }
  .sns {
    display: flex;
    justify-content: space-between;
    align-items: center;
    width: 5.5rem;
    li {
      a {
        display: inline-block;
        width: 2.2rem;
        img {
          width: 100%;
        }
      }
    }
  }
}

/* 390 이하 */
@media (max-width: 390px) {
  #health-section {
    .bg-text {
      width: 335px;
    }
  }
}

/* 360 이하 */
@media (max-width: 360px) {
  .header-left {
    .header-logo {
      width: 120px;
    }
    .language {
      .language-btn {
        width: 35px;
        height: 35px;
        &:before {
          right: -7px;
        }
        img {
          width: 70%;
        }
      }
    }
  }
  .header-right {
    .menu-trigger {
      width: 30px;
      height: 20px;
      margin-left: 10px;
    }
  }
}

